B.UW=new A.u8("Vom Gamer zum Informatiker","Meine Leidenschaft f\xfcr Videospiele und Technik f\xfchrte mich zur Informatik. Schon als Kind habe ich Videospiele geliebt. Ich habe mir immer gew\xfcnscht, mein eigenes Traumspiel zu entwickeln oder meine Lieblingsspiele zu verbessern. Dieser Traum hat mich dazu motiviert, Spieleentwickler zu werden. Mit zw\xf6lf Jahren habe ich mir durch das Austragen von Zeitungen einen eigenen Computer gekauft. Ich habe ihn selbst zusammengebaut und bald darauf angefangen, auch Computer f\xfcr andere zusammenzubauen, zu reparieren und neu aufzusetzen. Diese Erfahrungen haben mir gezeigt, dass ich Spa\xdf an Technik habe, in allen Branchen arbeiten k\xf6nnte und dass ich anderen Menschen helfen kann.","assets/images/aboutzocken1.jpg",null)
B.V_=new A.B1("Von Spielen zu Apps","In meinem Informatik-Studium suchte ich nach einer Alternative, die mich genau so begeistert wie die Spieleentwicklung. Dabei habe ich die faszinierende Welt der App- und Webentwicklung entdeckt. Sowohl in der Spieleentwicklung als auch in der App-Entwicklung fand ich Aspekte, die mich extrem begeisterten. Die psychologischen Aspekte in der Benutzererfahrung, die kreative Vielfalt und nat\xfcrlich die unz\xe4hligen Aufgaben beim Programmieren. Kein Spiel und keine App wird immer exakt gleich entwickelt. Meine Forschung \xfcber Progressive Web Apps und meine Bachelorarbeit \xfcber Flutter f\xfchrten mich schlie\xdflich zur Cross-Platform-Entwicklung. Die Cross-Platform-Entwicklung ist f\xfcr mich ein extrem m\xe4chtiges und vielseitiges Feld.","assets/images/aboutzocken3.jpg",null)
B.UY=new A.u8("Berufseinstieg","Nachdem ich meinen Informatikabschluss erfolgreich abgeschlossen hatte, tauchte ich privat tiefer in das Thema UI/UX-Design ein. Mein Berufseinstieg hatte ich im Bereich E-Health, wo ich an diversen Flutter- und Angular-Anwendungen f\xfcr internationale Krankenh\xe4user arbeitete. Zus\xe4tzlich konzipierte ich Prototypen, darunter ein neues Konzept f\xfcr die Strahlentherapie. Der Gedanke, Patienten und \xc4rzten zu helfen, verlieh mir ein Gef\xfchl wie ein Superheld zu sein.\n\nMeine Reise f\xfchrte mich als n\xe4chstes zu einem renommierten Beratungsunternehmen. Dort war ich in Projekten f\xfcr die Telekom und die ARD involviert, erweiterte meine F\xe4higkeiten in Angular, React und erlangte die Zertifizierung als React Developer. Doch obwohl ich viel lernte, f\xfchlte ich mich in diesem Umfeld nicht wohl. Ich stand vor der Wahl, entweder in den Bereich E-Health zur\xfcckzukehren, wo ich mich erf\xfcllt f\xfchlte, oder aber die Gelegenheit als Freiberufler zu ergreifen.","assets/images/contactMe.jpg",null)
B.UZ=new A.B1("Freelancer","In meiner aktuellen Situation bietet sich mir die Gelegenheit, mich als Freelancer zu versuchen. Gleichzeitig habe ich schon lange den Wunsch, einen Videokurs zu erstellen und ein Buch zu ver\xf6ffentlichen. Ich w\xfcrde gerne das Gesicht von meinem j\xfcngeren Ich sehen, wenn er erfahren k\xf6nnte, dass ich gerade an einem Buch schreibe. Mein Ziel ist es, Unternehmen mit meiner Expertise zu unterst\xfctzen und gleichzeitig die Freiheit zu genie\xdfen, alles auszuprobieren, worauf ich gerade Lust habe. Es wird eine spannende Zeit, in der ich meine berufliche Entfaltung mit meinen kreativen Tr\xe4umen verkn\xfcpfen kann und dabei die Flexibilit\xe4t des Freelancer-Daseins erlebe.","assets/images/contactMe2.jpg",null)
B.UX=new A.u8("Privat","In meinem Privatleben bin ich, wie bereits erw\xe4hnt, ein leidenschaftlicher Gamer und Technik-Nerd, der aber auch gerne neue Dinge ausprobiert. Ich habe mich mit Sport, Ern\xe4hrung, Kochen/Backen, Game Engines und vielem mehr besch\xe4ftigt. In meiner Freizeit liebe ich es auch zu reisen. 2023 unternahm ich eine Solo-Tour \xfcber D\xe4nemark nach Schweden und stellte mich dort einem 7vsWild-Selbstexperiment. Einige Monate sp\xe4ter schloss ich mich einer v\xf6llig fremden Reisegruppe an und reiste nach Panama, sprang aus einem Helikopter und verbrachten 11 Tage auf einer einsamen Insel. Im Jahr 2024 ist mein Ziel, die spanische Sprache zu erlernen und mich auf meine Pers\xf6nlichkeitsentwicklung zu konzentrieren.","assets/images/aboutprivat.jpg",null)
