B.Oo=new A.dB("Consulting &\nDevelopment","Flutter | Angular | React: Mobile and Web","Wenn ihr eure Anwendung auf allen f\xfchrenden Plattformen auf den Markt bringen wollt, seid ihr bei mir genau richtig. Ich bin auf Cross-Platform-Technologien spezialisiert, ein Experte in Flutter und ein zertifizierter React Developer. Gemeinsam k\xf6nnen wir Anwendungen f\xfcr Android, iOS, Web, Windows, MacOS und Linux auf den Markt bringen. Ich kann euer Team unterst\xfctzen, wir starten zusammen bei null oder ihr spart mit meinem Flutter Starthilfe Template 8 Wochen Entwicklungszeit.",null)
B.Op=new A.dB("Rettung","Flutter | Angular | React | Design","Zu meinen Leistungen geh\xf6ren nicht nur die Entwicklung, das Design, die Reviews und die Wartung, sondern auch die Rettung von Projekten, die ins Stocken geraten sind. Wir analysieren gemeinsam das Projekt und ich empfehle Ma\xdfnahmen, um Kosten sowie Zeit zu sparen. Auf diese Weise bringen wir eure Anwendung wieder auf Kurs und minimieren den Verlust.",null)
B.Oq=new A.dB("UI/UX-Design","Wireframes, Prototyping, Figma, Adobe XD","Auch eine technisch perfekte Anwendung ist nutzlos, wenn die Benutzer eure Anwendung meiden. Mein Ziel ist es, das volle Potenzial eurer Produkte durch ma\xdfgeschneiderte UI/UX-Designs zu entfalten. Wir k\xf6nnen gemeinsam einen v\xf6llig neuen Prototypen konzipieren oder eure bestehenden Designs erweitern - zusammen k\xf6nnen wir das Nutzererlebnis auf ein neues Level bringen. Meine Aufgabe ist es sicherzustellen, dass eure Anwendung nicht nur funktional, sondern auch ansprechend und benutzerfreundlich ist.",null)
B.Or=new A.dB("Reviews","Flutter | Angular | React","Warum ist ein Review wichtig, wenn wir doch Experten im Team haben? Oft fehlt in einem Team ein neutraler Blick auf die Prozesse und Probleme werden besch\xf6nigt. Durch die Einbeziehung einer externen Person ist es effektiver, Prozesse zu analysieren, die bestehende Code-Basis kritisch zu \xfcberpr\xfcfen und effizient wieder auf den richtigen Weg zu kommen.",null)
B.Os=new A.dB("Coaching","Flutter | UI/UX-Design","Egal, ob ihr Anf\xe4nger seid oder schon fortgeschrittene Kenntnisse habt, ich bereite euch auf das Flutter Framework vor. In meinen Workshops unterrichte ich Teams, Studenten und Sch\xfcler in einem Zeitraum von 2 bis 10 Tagen. Ich ber\xfccksichtige den aktuellen Wissensstand der Teilnehmer und gestalte meine Lehrinhalte entsprechend ihren individuellen Bed\xfcrfnissen und ihrem Tempo. Gemeinsam werden wir nicht nur die Grundlagen von Flutter und Dart meistern, sondern auch in der Lage sein, skalierbare, wartbare und performante Anwendungen zu entwickeln.",null)
B.Ot=new A.dB("\xdcbernahme &\nWartung","Flutter | Angular | React","Ist Ihre Anwendung schon seit einiger Zeit in Betrieb? Dann haben Sie wahrscheinlich bereits notwendige Wartungsarbeiten und Updates durchgef\xfchrt. Ich biete Dienste zur \xdcbernahme und Wartung von Anwendungen an. Dabei konzentriere ich mich auf Bugfixing, Optimierung, Erweiterung und kontinuierliche Wartung. Ob Sie eine einmalige Wartung bevorzugen oder regelm\xe4\xdfige Wartungen ben\xf6tigen, passt sich ganz nach Ihren W\xfcnschen und Anforderungen an.",null)
